import React, { useState } from "react";
import {
  View,
  Text,
  TextInput,
  TouchableOpacity,
  CheckBox,
} from "react-native";
import { useNavigation } from "@react-navigation/native";
import ForgotYourPasswordComp from "./components/login/forgotYourPasswordComp";


export default function LoginComp() {
  const navigation = useNavigation();

  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [rememberMe, setRememberMe] = useState(false);

  const handleLogin = () => {
    // Add your login logic here
    console.log("Username:", username);
    console.log("Password:", password);
    console.log("Remember Me:", rememberMe);
  };

  return (
    <View>
      <Text>LoginComp</Text>

      <Text>Username or primary email</Text>
      <TextInput
        value={username}
        onChangeText={setUsername}
        // placeholder="Enter your username"
      />

      <Text>Password</Text>
      <TextInput
        value={password}
        onChangeText={setPassword}
        // placeholder="Enter your password"
        secureTextEntry
      />

      <View style={{ flexDirection: "row", alignItems: "center" }}>
        <CheckBox value={rememberMe} onValueChange={setRememberMe} />
        <Text style={{ marginLeft: 8 }}>Remember me</Text>
      </View>

      <TouchableOpacity onPress={handleLogin}>
        <Text>Login</Text>
      </TouchableOpacity>

      <TouchableOpacity onPress={()=> navigation.navigate('forgotYourPasswordComp')}>
        <Text style={{ color: "red" }}>Forgot your password?</Text>
      </TouchableOpacity>
    </View>
  );
}
